// static
bool UnzipperStubDispatch::AcceptWithResponder(Unzipper* impl, mojo::Message* message, std::unique_ptr<mojo::MessageReceiverWithStatus> responder)
{
    [[maybe_unused]] const bool message_is_sync = message->has_flag(mojo::Message::kFlagIsSync);
    [[maybe_unused]] const uint64_t request_id = message->request_id();
    switch (static_cast<messages::Unzipper>(message->header()->name)) {
    case messages::Unzipper::kUnzip: {
        internal::Unzipper_Unzip_Params_Data* params = reinterpret_cast<internal::Unzipper_Unzip_Params_Data*>(message->mutable_payload());

        // Validation for Unzipper.0
        bool success = true;
        ::base::File p_zip_file {};
        ::mojo::PendingRemote<::storage::mojom::Directory> p_output_dir {};
        UnzipOptionsPtr p_options {};
        ::mojo::PendingRemote<UnzipFilter> p_filter {};
        ::mojo::PendingRemote<UnzipListener> p_listener {};
        Unzipper_Unzip_ParamsDataView input_data_view(params, message);

        if (success && !input_data_view.ReadZipFile(&p_zip_file))
            success = false;
        if (success) {
            p_output_dir = input_data_view.TakeOutputDir<decltype(p_output_dir)>();
        }
        if (success && !input_data_view.ReadOptions(&p_options))
            success = false;
        if (success) {
            p_filter = input_data_view.TakeFilter<decltype(p_filter)>();
        }
        if (success) {
            p_listener = input_data_view.TakeListener<decltype(p_listener)>();
        }
        if (!success) {
            ReportValidationErrorForMessage(message, mojo::internal::VALIDATION_ERROR_DESERIALIZATION_FAILED, Unzipper::Name_, 0, false);
            return false;
        }
        Unzipper::UnzipCallback callback = Unzipper_Unzip_ProxyToResponder::CreateCallback(*message, std::move(responder));
        // A null |impl| means no implementation was bound.
        DCHECK(impl);
        impl->Unzip(std::move(p_zip_file), std::move(p_output_dir), std::move(p_options), std::move(p_filter), std::move(p_listener), std::move(callback));
        return true;
    }
    case messages::Unzipper::kDetectEncoding: {
        internal::Unzipper_DetectEncoding_Params_Data* params = reinterpret_cast<internal::Unzipper_DetectEncoding_Params_Data*>(message->mutable_payload());

        // Validation for Unzipper.1
        bool success = true;
        ::base::File p_zip_file {};
        Unzipper_DetectEncoding_ParamsDataView input_data_view(params, message);

        if (success && !input_data_view.ReadZipFile(&p_zip_file))
            success = false;
        if (!success) {
            ReportValidationErrorForMessage(message, mojo::internal::VALIDATION_ERROR_DESERIALIZATION_FAILED, Unzipper::Name_, 1, false);
            return false;
        }
        Unzipper::DetectEncodingCallback callback = Unzipper_DetectEncoding_ProxyToResponder::CreateCallback(*message, std::move(responder));
        // A null |impl| means no implementation was bound.
        DCHECK(impl);
        impl->DetectEncoding(std::move(p_zip_file), std::move(callback));
        return true;
    }
    case messages::Unzipper::kGetExtractedInfo: {
        internal::Unzipper_GetExtractedInfo_Params_Data* params
            = reinterpret_cast<internal::Unzipper_GetExtractedInfo_Params_Data*>(message->mutable_payload());

        // Validation for Unzipper.2
        bool success = true;
        ::base::File p_zip_file {};
        Unzipper_GetExtractedInfo_ParamsDataView input_data_view(params, message);

        if (success && !input_data_view.ReadZipFile(&p_zip_file))
            success = false;
        if (!success) {
            ReportValidationErrorForMessage(message, mojo::internal::VALIDATION_ERROR_DESERIALIZATION_FAILED, Unzipper::Name_, 2, false);
            return false;
        }
        Unzipper::GetExtractedInfoCallback callback = Unzipper_GetExtractedInfo_ProxyToResponder::CreateCallback(*message, std::move(responder));
        // A null |impl| means no implementation was bound.
        DCHECK(impl);
        impl->GetExtractedInfo(std::move(p_zip_file), std::move(callback));
        return true;
    }
    }
    return false;
}
